import logo from './logo.svg';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import './App.css';
import Home from './components/Home';
import BusHome from './components/BusHome';
import Login from './components/Login';
import Register from './components/Register';

function App() {
  return (
    <div className="GeeksForGeeks">
      <div className='text-center text-danger'>
      <h2> Bachi RTC Online Ticket Booking </h2>
     </div>
      <Router>
        <Routes>
          <Route path='/' element={<BusHome />}></Route>
          <Route path='/hone' element={<BusHome />}></Route>
          <Route path='/log-in' element={<Login />}></Route>
          <Route path="/register" element={<Register />}></Route>
          {/* <Route path='/' element={<Game />}></Route>
          <Route path='/game-easy' element={<GameEasy />}></Route>
          <Route path='/game-hard' element={<GameHard />}></Route> */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
